   325→
   326→const userId = createUserId("user-123");
   327→getUser(userId);  // OK
   328→// getUser(createOrderId("order-456"));  // Error!
   329→```
   330→
   331→### Result Type
   332→
   333→```typescript
   334→type Result<T, E = Error> =
   335→  | { success: true; data: T }
   336→  | { success: false; error: E };
   337→
   338→function divide(a: number, b: number): Result<number, string> {
